import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const InputTask = () => {
  return (
    <div className="card">
      <div htmlFor="inputTodo" className="card-title">
        Add Todo
      </div>
      <form>
        <div>
          <input type="submit" className="btn btn-primary" />
        </div>
      </form>
    </div>
  );
};
export default InputTask;
